let inputData = ``;

const isUpper = (inputChar) => {
  return (inputChar === inputChar.toUpperCase());
};

const fullyReact = (inputString) => {

  const arrString = inputString.split('');

  let found;
  let done = false;
  let startIndex = 0;

  while (!done) {
    found = false;
    for (let i = startIndex; i < arrString.length - 1; i++) {
      if (isUpper(arrString[i])) {
        if (arrString[i].toLowerCase() === arrString[i + 1]) {
          found = true;
        }
      } else {
        if (arrString[i].toUpperCase() === arrString[i + 1]) {
          found = true;
        }
      };
      if (found) {
          arrString.splice(i, 2);
          startIndex = (i > 0) ? i - 1 : 0;
          break;
      };
    };
    if (!found) {
      done = true;
    };
  };

  return arrString.length;

};

const removeUnit = (inputString, regexChar) => {
  
  return inputString.replace(regexChar, '')

};

// Part 1

console.log('Part 1', fullyReact(inputData));

// Part 2

const strAlphabet = 'abcdefghijklmnopqrstuvwxyz';
let regexChar;
let selectedChar;
let shortestLength = -1;
let currentLength;

for (let i = 0; i < strAlphabet.length; i++) {
  regexChar = new RegExp(strAlphabet.charAt(i), 'ig');
  if (regexChar.test(inputData)) {
    currentLength = fullyReact(removeUnit(inputData, regexChar));
    shortestLength = (shortestLength === -1) ? currentLength : (currentLength < shortestLength) ? currentLength : shortestLength;
  };
}

console.log('Part 2', shortestLength);
